import React from 'react';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import HeroSection from './components/HeroSection';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <>
    <Router>
      <Navbar />
      <Routes>
        <Route path='/' element={
          <div>
            <div className="flex row">
              <div className="logo "id="graded-logo"/>
              <div className="logo "id="elevated-logo-full"/>
              <div className="logo "id="ib-logo"/>
            </div>
            <HeroSection title="Home" buttons={[
              {text: "Subjects", link: "/subjects"},
              {text: "Resources", link: "/resources"},
              {text: "About Us", link: "/about"},
              {text: "Submit", link: "/submit"}
            ]}/>
          </div>
        } />
        <Route path='/subjects' element={
          <div>
            <h1>These are the subjects.</h1>
          </div>
        } />
        <Route path='/resources' element={
          <div>
            <h1>I love Gisela (she's so cool) (and sexy)</h1>
          </div>
        } />
      </Routes>
      <Footer />
    </Router>
    </>
  );
}

export default App;
